import React from 'react'

import PropTypes from 'prop-types'

const ItemSort = (props) => {
  return (
    <>
      <div className="container">
        <div className="dragable">
          <svg viewBox="0 0 219.42857142857142 1024" className="thqIcon icon">
            <title>ellipsis-v</title>
            <path d="M219.429 713.143v109.714c0 30.286-24.571 54.857-54.857 54.857h-109.714c-30.286 0-54.857-24.571-54.857-54.857v-109.714c0-30.286 24.571-54.857 54.857-54.857h109.714c30.286 0 54.857 24.571 54.857 54.857zM219.429 420.571v109.714c0 30.286-24.571 54.857-54.857 54.857h-109.714c-30.286 0-54.857-24.571-54.857-54.857v-109.714c0-30.286 24.571-54.857 54.857-54.857h109.714c30.286 0 54.857 24.571 54.857 54.857zM219.429 128v109.714c0 30.286-24.571 54.857-54.857 54.857h-109.714c-30.286 0-54.857-24.571-54.857-54.857v-109.714c0-30.286 24.571-54.857 54.857-54.857h109.714c30.286 0 54.857 24.571 54.857 54.857z"></path>
          </svg>
        </div>
        <div className="container1">
          <img src={props.src} className="thqImage image" />
        </div>
        <div className="container2">
          <h4 className="thqHeading4 text">{props.heading}</h4>
        </div>
        <div className="container3">
          <button className="thqButton button">Edit</button>
        </div>
      </div>
      <style jsx>
        {`
          .container {
            width: 100%;
            display: flex;
            padding: 10px;
            overflow: auto;
            flex-wrap: wrap;
            align-items: center;
            border-color: #dbdbdb;
            border-width: 1px;
            flex-direction: row;
            justify-content: flex-start;
            background-color: #ffffff;
          }
          .dragable {
            display: flex;
            padding: 10px;
            flex-wrap: wrap;
            align-items: center;
            flex-direction: row;
            justify-content: flex-start;
          }
          .icon {
            fill: #dbdbdb;
            width: 24px;
            height: 24px;
            padding: 1px;
          }
          .container1 {
            width: 50px;
            height: 50px;
            margin: 10px;
            display: flex;
            overflow: hidden;
            flex-wrap: wrap;
            align-items: center;
            border-radius: 50%;
            flex-direction: row;
            justify-content: flex-start;
            background-color: rgba(120, 120, 120, 0.4);
          }
          .image {
            height: 50px;
            min-width: 100%;
            align-self: stretch;
            object-fit: cover;
            object-position: center;
          }
          .container2 {
            display: flex;
            padding: 10px;
            flex-grow: 1;
            flex-wrap: wrap;
            align-items: center;
            flex-direction: row;
            justify-content: flex-start;
          }
          .text {
            flex-grow: 0;
          }
          .container3 {
            display: flex;
            padding: 10px;
            flex-wrap: wrap;
            align-items: center;
            flex-direction: row;
            justify-content: flex-end;
          }
          .button {
            display: block;
            border-color: #0a8827;
          }
        `}
      </style>
    </>
  )
}

ItemSort.defaultProps = {
  src: 'https://play.teleporthq.io/static/svg/placeholders/no-image.svg',
  heading: 'Heading',
}

ItemSort.propTypes = {
  src: PropTypes.string,
  heading: PropTypes.string,
}

export default ItemSort
